body:
Facing the same problem on win10 while using Qt Creator and CUDA 11..4 (where any other CUD Aapps are working, such OpenCV and Libtorch)
Downloaded the package onnxruntime-win-x64-gpu-1.9.0.zip from https://github.com/microsoft/onnxruntime/releases/tag/v1.9.0

```
INCLUDEPATH += C:\lib\onnxruntime-win-x64-gpu-1.9.0\include
LIBS += C:\lib\onnxruntime-win-x64-gpu-1.9.0\lib\*.lib
```

Just including onnxruntime_cxx_api.h it builds without errors but running the .exe file I get:

> The application was unable to start correctly (0x0000007b)

```
#include <iostream>
#include <onnxruntime_cxx_api.h>

using namespace std;

int main()
{
    cout << "Hello World!" << endl;
    return 0
}
```

**Solved** After copying the dll in the same folder as the executable, as per https://github.com/microsoft/onnxruntime/issues/6243#issuecomment-913670951
